import React from 'react';
import{
  Container,
  Badge,
  Breadcrumb,

} from "react-bootstrap";

function App(){
  return(
    <Container>
    <Breadcrumb>
      <Badge variant="primary">Website React Bootstrap</Badge>
    </Breadcrumb>
    </Container>
  );
}

export default App;
